var questId = 41077;
var npcId = 99468;
var npcPosition = new Vector3(4296.845, 3612.227, 898.9398, "None");
var huntPosition = npcPosition;
var huntRadius = 300;
var weaponRackId = 246975;
if (!Quest.HasQuest(questId))
	GoToTask.ToPosition(npcPosition);

if (!WorldQuest.Complete(questId, 1))
	GoToTask.ToPositionAndIntecractWithNpc(npcPosition, npcId, 1);

if (!WorldQuest.Complete(questId, 2))
	GoToTask.ToPositionAndIntecractWithGameObject(npcPosition, weaponRackId);

if (ObjectManager.Me.Position.DistanceTo(huntPosition) > huntRadius)
{
	//Logging.Write("go to hunt area");
	GoToTask.ToPosition(huntPosition);
}

var maxDist = 35;
var mobs = new List<int>()
{
	//41076
	97976, //Bonebeak Hawk
	98273, //Icefang Howler
	103592, //Bonebeak Hawk
};

var mobEntry = ObjectManager.GetNearestWoWUnit(ObjectManager.GetWoWUnitByEntry(mobs));
if (mobEntry != null && mobEntry.IsAlive && mobEntry.IsAttackable && mobEntry.IsValid)
{
	Interact.InteractGameObject(mobEntry.GetBaseAddress);
	MovementManager.Face(mobEntry);
	if (mobEntry.Position.DistanceTo(ObjectManager.Me.Position) > maxDist)
	{
		//Logging.Write("found victim. getting closer");
		var closePosition = mobEntry.Position.InFrontOf(ObjectManager.Me.Rotation, -29);
		var wp = wManager.Wow.Helpers.PathFinder.FindPath(closePosition);
		wManager.Wow.Helpers.MovementManager.Go(wp);
		return true;
	}
	MovementManager.StopMove();
	wManager.Wow.Helpers.Lua.LuaDoString("ExtraActionButton1:Click()");
	//Logging.Write("attack victim");
	Thread.Sleep(Usefuls.Latency * 2);
	wManager.Wow.Helpers.Usefuls.WaitIsCasting();
	return true;
}
//Logging.Write("end pulse");
return true;

