var mobId = 97220;
var campPosition = new Vector3(4603.222, 4244.349, 820.5134, "None");
var npcId = 97215;
if (ObjectManager.Me.Position.DistanceTo(campPosition) > 100)
	GoToTask.ToPosition(campPosition);

var mobEntry = ObjectManager.GetNearestWoWUnit(ObjectManager.GetWoWUnitByEntry(mobId));
if (mobEntry != null && mobEntry.IsAlive && mobEntry.IsAttackable && mobEntry.IsValid && mobEntry.HealthPercent < 100)
{
	Fight.StartFight(mobEntry.Guid);
	return true;
}

GoToTask.ToPositionAndIntecractWithNpc(campPosition, npcId, 1);
Thread.Sleep(5 * 1000);
return true;

